DROP TABLE IF EXISTS `desembolso`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `desembolso` (
  `codigo` int(11) NOT NULL AUTO_INCREMENT,
  `codReg` int(11) NOT NULL,
  `visitaInstitu` date DEFAULT NULL COMMENT 'fecha visita insitu',
  `visitaNombre` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Nombre del archivo generado por la visita insitu',
  `visitaEmitido` int(11) DEFAULT NULL COMMENT 'Nombre del encargado de emitir la visita insitu',
  `visitaObservacion` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  `alcanceCesion` date DEFAULT NULL COMMENT 'fecha alcance de cesión',
  `alcanceCesionNombre` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  `alcanceCesionEmitido` int(11) DEFAULT NULL,
  `alcanceCesionObservacion` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  `aceptacionCesion` date DEFAULT NULL,
  `acept_cesionNombre` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Nombre del archivo generado por la aceptación de cesión',
  `acept_cesionEmitido` int(11) DEFAULT NULL,
  `acept_cesionObservacion` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  `turnoPago` date DEFAULT NULL,
  `noTurno` varchar(30) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Número del turno de pago',
  `turnoArchivoNombre` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  `turnoArchivoEmitido` int(11) DEFAULT NULL,
  `turnoArchivoObservacion` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  `instruccion` date DEFAULT NULL,
  `instrucGiroNombre` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Nombre del archivo generado por la instrucción de giro',
  `instrucGiroEmitido` int(11) DEFAULT NULL,
  `instrucGiroObservacion` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  `certificacionBco` date DEFAULT NULL,
  `bcoCertificacionNombre` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL COMMENT 'Nombre del archivo generado por la certificación bancaria',
  `bcoCertificacionEmitido` int(11) DEFAULT NULL,
  `bcoCertificacionObservacion` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  `liquidacionFin` date DEFAULT NULL,
  `liquidacionNombre` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  `liquidacionEmitido` int(11) DEFAULT NULL,
  `liquidacionObservacion` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  `fechaOtorgamiento` date DEFAULT NULL COMMENT 'fecha de otorgamiento de poder',
  `otorgamientoPoderNombre` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  `otorgamientoPoderEmitido` int(11) DEFAULT NULL,
  `otorgamientoPoderObservacion` varchar(150) CHARACTER SET utf8 COLLATE utf8_spanish2_ci DEFAULT NULL,
  PRIMARY KEY (`codigo`)
) ENGINE=InnoDB AUTO_INCREMENT=555 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish2_ci COMMENT='repositorio de documentos de desembolso';
/*!40101 SET character_set_client = @saved_cs_client */;

